import React from 'react';
import { Link } from 'react-router-dom';
import './NavBar.css'
import logo from '../../img/logo.png'


export function NavBar() {
    return (
        <nav >
        <img src={logo} alt='...' />
        <ul>
        <Link to='/'> <li className='dropbtn'> iWorld!</li> </Link>
        <Link to='/home'> <li className='dropbtn'> Home </li> </Link>
        <li className="dropdown"> <p className='dropbtn'>Actividades </p>
           <div className="dropdown-content">
             <Link to='/addactivity'> Agregar Actividades</Link>
             <Link to='/listactivity'>Ver Actividades por Pais</Link>
           </div>
          </li>
        <Link to='/about'> <li className='dropbtn'> Sobre el Proyecto</li> </Link>
        </ul>
    </nav>
    )
};

export default NavBar;
